import React from 'react'
import logo from './assets/Mlogo.png'
import './Header.css';
import MenuIcon from '@material-ui/icons/Menu';

const Header = () => {
    return (
        <div className="header">
            <img 
            className="header__logo"
            src={logo}
            alt='portfolio logo'
            /> 
            <MenuIcon fontSize="large"/>
        </div>
    )
}

export default Header
